import React, { useEffect } from 'react';
import Layout from '../../Components/Layout/Layout';

const ModeltestUnit = (props) => {
    /*
    useEffect(async () => {
        try {
            const res = await axios.get(`/get/helmet/${props.match.params.slug}`);
            setBrandLists(res.data.helmets);
        } catch (err) {
            setError("Something wrong!");
        }
    }, []);*/
    return (
        <Layout>
            <div className="mainDiv">
                Course unit Id: {props.match.params.unitId}
                <br/>
                Course name :{props.match.params.slug}
            </div>

        </Layout>
        
    );
};

export default ModeltestUnit;
